query siteAvailableVersionList ( $accountId:ID! $availableVersionListInput:AvailableVersionListInput!) {
	site ( accountId:$accountId input:$availableVersionListInput ) {
		availableVersionList ( input:$availableVersionListInput  )  {
			items {
	platform {
		platform
		versions
	}
	versions {
		platform
		versions
	}
			}
		}
	}	
}
